(193, 55, '_elementor_data', '[{\"id\":\"c6882da\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"8d24cc1\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"e1a4afd\",\"elType\":\"widget\",\"settings\":{\"title\":\"NUTRIENT DELIVERY\"},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"170ee6b\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"42793fb\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"c7bd49a\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>The future is here at Madre Terra Science, LLC. While basic methods of liposomal delivery have been around for many years, true nano-enhanced liposomal delivery provides the best results. Studies have shown that small (nano) sized particles increase bioavailability, increase cellular delivery, and increase oral uptake and lymphatic absorption by 5-10 times over larger sized liposomes. Additionally, lymphatic delivery via liposomes bypasses the first-pass metabolism in the liver, which also increases oral bioavailability. Smaller liposomal spheres and emulsions are the result of refined chemistry and high-shear equipment, which of course, comes at a cost in terms of production. We take tremendous pride in offering this cutting edge science and technology to our valued customers at an affordable price. Nutrient Many companies produce liposomes that are instable, and are too large in size for the body to optimally absorb and utilize them. For liposomal supplement delivery, size really does matter.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"5346c60\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"cfcedab\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/cbd\\/wp-content\\/uploads\\/20