(13, 1, '2020-09-18 12:49:53', '2020-09-18 12:49:53', '<strong>BRAIN-NF® CBD</strong> combines 98%+ pure isolate CBD with NeuroFactor®, an all-natural, patented ingredient made from the whole fruit (including the bean) of the coffee plant, Coffea arabica, clinically researched for brain health support. † - NeuroFactor® has been shown to significantly increase Brain Derived Neurotropic Factor (BDNF) levels in two double blind, peer-reviewed studies of healthy human subjects.\r\n\r\n<strong>† – BDNF</strong> has been widely reported to play a critical role in the development, maintenance, and repair of neurons, and protection against neurodegeneration.\r\n\r\n<strong>†</strong> These statements have not been evaluated by the Food &amp; Drug Administration. This product is not intended to diagnose, treat, cure, or prevent any disease.\r\n\r\n<strong>SUGGESTED USE:</strong> Adults take 2 full droppers (2 mL) per day, or as directed by a qualified healthcare professional.\r\n\r\n<strong>SHAKE WELL BEFORE EACH USE.</strong>\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'CBD INFUSED BRAIN SUPPORT', '', 'publish', 'open', 'closed', '', 'cbd-infused-brain-support', '', '', '2020-09-18 13:52:56', '2020-09-18 13:52:56', '', 0, 'http://localhost/cbd/?post_type=product&#038;p=13', 0, 'product', '', 0),
