(51, 1, '2020-09-18 13:35:02', '2020-09-18 13:35:02', 'BRAIN-NF® CBD combines 98%+ pure isolate CBD with NeuroFactor®, an all-natural, patented ingredient made from the whole fruit (including the bean) of the coffee plant, Coffea arabica, clinically researched for brain health support. † - NeuroFactor® has been shown to significantly increase Brain Derived Neurotropic Factor (BDNF) levels in two double blind, peer-reviewed studies of healthy human subjects.\n\n† – BDNF has been widely reported to play a critical role in the development, maintenance, and repair of neurons, and protection against neurodegeneration.\n\n† These statements have not been evaluated by the Food &amp; Drug Administration. This product is not intended to diagnose, treat, cure, or prevent any disease.\n\nSUGGESTED USE: Adults take 2 full droppers (2 mL) per day, or as directed by a qualified healthcare professional.\n\nSHAKE WELL BEFORE EACH USE.\n\n<table class=\"table table-bordered\">\n  <thead>\n    <tr>\n      <th scope=\"col\">#</th>\n      <th scope=\"col\">First</th>\n      <th scope=\"col\">Last</th>\n      <th scope=\"col\">Handle</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <th scope=\"row\">1</th>\n      <td>Mark</td>\n      <td>Otto</td>\n      <td>@mdo</td>\n    </tr>\n    <tr>\n      <th scope=\"row\">2</th>\n      <td>Jacob</td>\n      <td>Thornton</td>\n      <td>@fat</td>\n    </tr>\n    <tr>\n      <th scope=\"row\">3</th>\n      <td colspan=\"2\">Larry the Bird</td>\n      <td>@twitter</td>\n    </tr>\n  </tbody>\n</table>', 'CBD INFUSED BRAIN SUPPORT', '', 'inherit', 'closed', 'closed', '', '13-autosave-v1', '', '', '2020-09-18 13:35:02', '2020-09-18 13:35:02', '', 13, 'http://localhost/cbd/2020/09/18/13-autosave-v1/', 0, 'revision', '', 0),
