(53, 1, '2020-09-18 13:38:54', '2020-09-18 13:38:54', '<h2>Why Chose Us</h2>		\n		<p><!-- wp:paragraph --></p>\n<p>In one word, experience. Madre Terra Science, a subsidiary of Vinco, Inc., has four decades of industry experience. We have always been at the forefront of innovative science-based nutrition resulting in positive clinical outcomes. You can be assured that the product you are using has been carefully sourced, manufactured to the highest industry standards set forth, and put into the hands of qualified healthcare professionals.</p>\n<p><!-- /wp:paragraph --></p>		\n										<img width=\"732\" height=\"549\" src=\"http://localhost/cbd/wp-content/uploads/2020/09/why-chooseus.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/cbd/wp-content/uploads/2020/09/why-chooseus.jpg 732w, http://localhost/cbd/wp-content/uploads/2020/09/why-chooseus-300x225.jpg 300w, http://localhost/cbd/wp-content/uploads/2020/09/why-chooseus-555x416.jpg 555w\" sizes=\"(max-width: 732px) 100vw, 732px\" />', 'WHY MADRE TERRA?', '', 'publish', 'closed', 'closed', '', 'why-madre-terra', '', '', '2020-09-18 13:50:10', '2020-09-18 13:50:10', '', 0, 'http://localhost/cbd/?page_id=53', 0, 'page', '', 0),
