(55, 1, '2020-09-18 13:40:07', '2020-09-18 13:40:07', '<h2>NUTRIENT DELIVERY</h2>		\n		<p>The future is here at Madre Terra Science, LLC. While basic methods of liposomal delivery have been around for many years, true nano-enhanced liposomal delivery provides the best results. Studies have shown that small (nano) sized particles increase bioavailability, increase cellular delivery, and increase oral uptake and lymphatic absorption by 5-10 times over larger sized liposomes. Additionally, lymphatic delivery via liposomes bypasses the first-pass metabolism in the liver, which also increases oral bioavailability. Smaller liposomal spheres and emulsions are the result of refined chemistry and high-shear equipment, which of course, comes at a cost in terms of production. We take tremendous pride in offering this cutting edge science and technology to our valued customers at an affordable price. Nutrient Many companies produce liposomes that are instable, and are too large in size for the body to optimally absorb and utilize them. For liposomal supplement delivery, size really does matter.</p>		\n										<img width=\"385\" height=\"385\" src=\"http://localhost/cbd/wp-content/uploads/2020/09/ad420a_43cc9b32720d42139172288f11f18498_mv2.png\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/cbd/wp-content/uploads/2020/09/ad420a_43cc9b32720d42139172288f11f18498_mv2.png 385w, http://localhost/cbd/wp-content/uploads/2020/09/ad420a_43cc9b32720d42139172288f11f18498_mv2-160x160.png 160w, http://localhost/cbd/wp-content/uploads/2020/09/ad420a_43cc9b32720d42139172288f11f18498_mv2-300x300.png 300w, http://localhost/cbd/wp-content/uploads/2020/09/ad420a_43cc9b32720d42139172288f11f18498_mv2-150x150.png 150w\" sizes=\"(max-width: 385px) 100vw, 385px\" />', 'NUTRIENT DELIVERY', '', 'publish', 'closed', 'closed', '', 'nutrient-delivery', '', '', '2020-09-18 13:47:02', '2020-09-18 13:47:02', '', 0, 'http://localhost/cbd/?page_id=55', 0, 'page', '', 0),
